A method container provides access to a method () and a MACAML method configuration (
). The method is loaded on demand when accessing the property - given a method exists and a valid storage path was provided (
). The method configuration is also loaded on demand when accessing the
property. However, it is loaded only if the method container is part of a data context and the underlying ACAML document provides a method configuration section or file (MACAML) for the method. A StorageProvider is only available when the MethodContainer is associated with a DataContext. All methods that require a StorageProvider will fail otherwise.

Raw data can be of type  for a chromatogram,
 for a spectrum,
or  for a spectra matrix.
